**Describe the bug**
I do inference in the loop structrue using onnxruntime c++ api like that:
```
// infer 100 times
for (unsigned int i = 0; i <100; i++)
{
  output_tensors = session.Run(Ort::RunOptions{nullptr}, input_names, &input_tensor, 1, output_names, 2);
  const auto boxes = output_tensors[0].GetTensorMutableData<float>();
  const auto labels = output_tensors[1].GetTensorMutableData<int>();
  //show top 1 box
  for (unsigned int i = 0; i < 1; i++)
  {
    std::cout << boxes[i*5+0] << " ";
    std::cout << boxes[i*5+1] << " ";
    std::cout << boxes[i*5+2] << " ";
    std::cout << boxes[i*5+3] << " ";
    std::cout << boxes[i*5+4] << " ";
    std::cout << labels[i] << std::endl;
  }
}
```
But I get some confusing results like that:
loop 1: 362.694 371.551 458.25 442.788 0.901355 7
loop 2: 368.575 363.632 444.877 446.542 0.168121 7
loop 3: 368.575 363.632 444.877 446.542 0.168121 7
loop 4: 368.575 363.632 444.877 446.542 0.168121 7
loop 5: 368.575 363.632 444.877 446.542 0.168121 7
...

the output of the first loop is ok, but the following output is confusing. The output should be same as the first loop.

My onnx model has a custom op, so I register it in the onnxruntime with cuda. I guess the issue is related to the registered custom op. Because the other models without custom op don't have the issue. 


**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):18.04
- ONNX Runtime installed from (source or binary):binary
- ONNX Runtime version:1.9.0
- CUDA/cuDNN version:11.2

**Describe the bug**
On opset version 11, when relu is followed by a clip (`clip(relu(x),-1,1)`), ORT raises segmentation fault.

**Urgency**
none

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Linux Ubuntu 18.04
- ONNX Runtime installed from (source or binary): binary
- ONNX Runtime version: 1.9.0
- Python version: 3.7.11
- Visual Studio version (if applicable): n/a
- GCC/Compiler version (if compiling from source): n/a
- CUDA/cuDNN version: 11.1/8.0.5
- GPU model and memory: RTX2080, 8GB
- PyTorch version: 1.10.0

**To Reproduce**
- Describe steps/code to reproduce the behavior.
```python
import torch
import onnx
import onnxruntime as ort


class Model(torch.nn.Module):
    @torch.no_grad()
    def forward(self, x):
        x = torch.relu(x)  # can run succesfully if comment out this line
        x = torch.clip(x, -1, 1)
        return x


model = Model()
inputs = (torch.randn(1, 1, 1, 1),)
output_names = ["output"]
torch.onnx.export(model, inputs, "1.onnx", verbose=False,
                  input_names=["input"], output_names=output_names, opset_version=11)

onnx_model = onnx.load("1.onnx")
sess = ort.InferenceSession(
    onnx._serialize(onnx_model))
res = sess.run(output_names, {"input": inputs[0].numpy()})
```
